import React, { useEffect, useState } from 'react';
import axios from 'axios';

const M = () => {
  const [data, setData] = useState([]);
  const bearerToken = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJzdWIiOiJVc2VyIGRldGFpbHMiLCJ1c2VybmFtZSI6InN0cmluZyIsImlzcyI6IkJhbmtfQXBwIiwiaWF0IjoxNjkwODM4ODUzLCJleHAiOjE2OTA4NDI0NTN9.QMVG4O0-9SQa3KSZdp1NoXgr3cB2eVlmDupPHTEJTAE'; // Replace this with your actual bearer token

  useEffect(() => {
    // Create a headers object with the Authorization header
    const headers = {
      Authorization: `Bearer ${bearerToken}`,
    };

    // Make the GET request using Axios
    axios
      .get('http://localhost:8080/exchange-rates/latest/pln', { headers })
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, [bearerToken]); // Include bearerToken in the dependency array to re-fetch data if token changes

  return (
    <div>
      <h1>Example Component</h1>
      {/* Render the data */}
      <ul>
        {data.map((item) => (
          <li key={item.id}>{item.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default ExampleComponent;
